content:
[​](https://telegra.ph/file/81fdb43a7b75fa09729da.jpg)🇷🇺 💬 Déclarations du ministre russe des Affaires étrangères, Sergueï Lavrov, lors d'une conférence de presse à la suite d'entretiens avec le ministre sud-africain des Affaires étrangères, Naledi Pandor :

🔹L'Occident ne mène plus une guerre hybride contre la Russie, mais presqu’une guerre réelle;

🔹La partie ukrainienne doit clarifier sa position sur les négociations avec la Russie; 

🔹Moscou n’abandonne pas les négociations, mais ceux qui les rejettent doivent comprendre que plus ils refusent de négocier, plus il sera difficile de trouver une solution; 

🔹L’ONU n'a pas contribué à la suppression des obstacles aux exportations de denrées alimentaires et d'engrais de la Russie dans le cadre de l’accord céréalier de la mer Noire;

🔹La Russie espère que le deuxième sommet Russie-Afrique fera monter les relations avec le continent africain à un niveau supérieur;

🔹La Russie contribuera activement à la normalisation de la situation dans les points chauds de l'Afrique en renforçant son potentiel de maintien de la paix sur le continent.

